import classes from "./SideNote.module.scss";

const SideNote = () => {
  return (
    <div className={classes.sidenote}>
      <p>
        Note to the Edvora Team: I currently have an exam so during the given 72
        hours I wont be able to complete the given task, but after the exam I
        would be totally free to be commited to this team and I am excited to do
        so
      </p>
    </div>
  );
};

export default SideNote;
